import './App.css';
import React, { useState, useEffect } from "react";
import axios from "axios";

function Home() {
  const [data, setData] = useState([]);


  useEffect(() => {
    axios
      .get("/index.php")
      .then((response) => {
        setData(response.data); // Assuming the data received is an array
      })
      .catch((error) => {
        console.log(error);
        setData([]); // Set data to an empty array or some default value
      });
  }, [data]);

  return (
    <div>
  {Array.isArray(data) ? (
    data.map((item) => (
      <p key={item.id}>
        Artist: {item.artist}, Song: {item.song}, Rating: {item.rating}
      </p>
    ))
  ) : (
    <p>No data available.</p>
  )}
</div>
  );
}

export default Home;
